import { gql, useQuery } from '@apollo/client'

const LOGIN = gql`
	query{
		login(email: $email, password: $password){
			accessToken
		}
	}
`

const useLoginQuery = (props) => {
    console.log(props);
    return useQuery(LOGIN,{
        variables : {
            ...props
        }
    })
}


export default useLoginQuery
